import { Component } from "react";

const styles = {
    navbar: {
        display: 'flex',
        flexDirection: 'row',
        alignItems: 'center',
        hight: '100px',
    },
};

class Navbar extends Component {
    render() {
        return (
            <nav style={styles.navbar}>
                <p>Logo</p>
                <p>Carro</p>
            </nav>
        );
    }
}

export default Navbar;
